our favorite tracks in unexpected new ways (from their earliest DJ blends to high-energy hybrids like the duo's hit remix of Major Lazer's "Original Don") certainly helps. So does having a catalog of original bangers on Fool's Gold, Green Label Sound and Mad Decent/Jeffree's. Yet the real reason Floss has been able to reinvent party rocking for close to a decade is because these Chicago boys bring an irresistible sense of fun to every single set, whether it's a sweat-soaked nightclub or in front of thousands at Lollapalooza. Armed with a gang of new tunes straight from the studio and a brand new, extra-hype stage show, Flosstradamus is coming back to a town near you… get ready to juke!","isMobileFriendly":"false","image":{"jumbo":{"path":"http://cdn.ticketfly.com/i/00/02/24/13/45-atjmbo.jpg","width":960,"height":640},"jumbo1":{"path":"http://cdn.ticketfly.com/i/00/02/24/13/45-atjmbo1.jpg","width":960,"height":540},"large":{"path":"http://cdn.ticketfly.com/i/00/02/24/13/45-atlg.jpg","width":300,"height":200},"large1":{"path":"http://cdn.ticketfly.com/i/00/02/24/13/45-atlg1.jpg","width":300,"height":200},"medium":{"path":"http://cdn.ticketfly.com/i/00/02/24/13/45-atmd.jpg","width":200,"height":133},"medium1":{"path":"http://cdn.ticketfly.com/i/00/02/24/13/45-atmd1.jpg","width":200,"height":133},"original":{"path":"http://cdn.ticketfly.com/i/00/02/24/13/45-og.jpg","width":1685,"height":1123},"small":{"path":"http://cdn.ticketfly.com/i/00/02/24/13/45-atsm.jpg","width":100,"height":67},"small1":{"path":"http://cdn.ticketfly.com/i/00/02/24/13/45-atsm1.jpg","width":100,"height":67},"square":{"path":"http://cdn.ticketfly.com/i/00/02/24/13/45-sq.jpg","width":100,"height":100},"squareSmall":{"path":"http://cdn.ticketfly.com/i/00/02/24/13/45-sqsm.jpg","width":60,"height":60},"xlarge":{"path":"http://cdn.ticketfly.com/i/00/02/24/13/45-atxl.jpg","width":500,"height":333},"xlarge1":{"path":"http://cdn.ticketfly.com/i/00/02/24/13/45-atxl1.jpg","width":500,"height":333},"xxlarge":{"path":"http://cdn.ticketfly.com/i/00/02/24/13/45-atxxl.jpg","width":650,"height":433},"xxlarge1":{"path":"http://cdn.ticketfly.com/i/00/02/24/13/45-atxxl1.jpg","width":650,"height":433}},"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"http://www.flosstradamus.com/","urlMySpace":"http://www.myspace.com/flosstradamus","urlFacebook":"http://www.facebook.com/flosstradamus","urlTwitter":"http://twitter.com/Flosstradamus","twitterScreenName":"Flosstradamus"}],"supports":[{"id":1676933,"name":"Towkio","startTime":null,"eventDescription":"SAVEMONEY","isMobileFriendly":"false","image":null,"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"http://www.towk.io/wavtheory","urlMySpace":"","urlFacebook":"https://www.facebook.com/pages/Towkio/163583337122464","urlTwitter":"http://twitter.com/towkio","twitterScreenName":"towkio"},{"id":1676935,"name":"Gent & Jawns","startTime":null,"eventDescription":"After developing respectable solo careers as DJs and producers, long-time friends Billy the Gent and Long Jawns officially banded together as Gent & Jawns becoming an unstoppable force in the world of club music. The release of their now classic Moombahton anthem "Vibrate" catapulted them to the top of everyone's list of producers to work with and landed them remixes for Datsik, Bare, and Muffler, as well as collaborations with Nadastrom, Torro Torro and JWLS. 

In early 2012 they worked with mega-producer Diplo on his Express Yourself EP, which topped the iTunes charts as the number one electronic album. They followed up with an absolutely stunning remix of the title track "Express Yourself," which saw repeated plays by many of the top DJs in the world. Shortly after, they released "Holler," their first official EP on Mad Decent's Jeffrees label. Jeffrees went on to earn the iTunes Label of the Year honors. The duo ended the year proper when they released "TURNUP", a party-inducing track that's being called the biggest trap song of 2012. In two weeks the track saw 80,000 plays and held position as the top electronic song on SoundCloud. 

While known for their world-class production, Gent & Jawns' secret weapon is their ability to perform live. Long Jawns is a legend in his hometown of Richmond, VA, where he is widely known for throwing the biggest and best parties the city has seen in years. Billy The Gent began DJing with support from his friend Dave Nada (Nadastrom, creator of Moombahton) in Washington, DC and quickly became a staple at the famous U-Street Music Hall. Together, Gent & Jawns have gone on to share the stage with top notch acts like Diplo, Dillon Francis, Nadastrom, Caspa, Craze, Die Antwoord, and more.","isMobileFriendly":"false","image":null,"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"http://www.gentandjawns.com/","urlMySpace":"","urlFacebook":"https://www.facebook.com/gentandjawns","urlTwitter":"http://twitter.com/GENTANDJAWNS","twitterScreenName":"GENTANDJAWNS"}],"urlEventDetailsUrl":"http://www.marathonmusicworks.com/event/1289621?utm_medium=api"}]}
